import React, { useState } from "react";
import Back from "../components/Back";

function FinalPage() {
  const [name, setName] = useState("");
  const [email, setEmail] = useState("");
  const [experienta, setExperienta] = useState("");

  return (
    <>
      {window.sessionStorage.getItem("Bilet") && (
        <>
          <div
            className="fullPage l"
            style={{
              display: "flex",
              justifyContent: "flex-start",
              flexDirection: "column",
              padding: "0 100px",
            }}
          >
            <Back />
            <div className="titlu">
              <h1>Va multumim pentru participare</h1>
            </div>
            <div className="form">
              <div className="left">
                <div className="row">
                  <input type="text" placeholder="Numele" onChange={(e)=>{setName(e.target.name)}} />
                  {/* <h3 style={{ left: -30 }}>Numele</h3> */}
                </div>
                <div className="row">
                  {/* <h3>Email</h3> */}
                  <input type="email" placeholder="Email" />
                </div>
                <div className="row">
                  <button>Submit</button>
                </div>
              </div>
              <div className="right">
                <textarea
                  placeholder="Cum ti s-a parut aceasta experienta?"
                ></textarea>
              </div>
            </div>
          </div>
        </>
      )}
    </>
  );
}

export default FinalPage;
